using Autofac;
using MillionAndUp.DL.V1.Repositories.Property;
using MillionAndUp.DL.V1.Repositories.PropertyImage;
using MillionAndUp.Entities.V1;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace MillionAndUp.Test.DL
{
    public class PropertyImageRepositoryTest
    {

        private IPropertyImageRepository service;
        PropertyImageEntity dto;

        [SetUp]
        public void InitializeObjets()
        {
            dto = new PropertyImageEntity();

            var container = new TestInyectionContainer().Container;
            service = container.Resolve<IPropertyImageRepository>();
        }


        [Test]
        public void Read_OK()
        {

            Dictionary<string, object> parameters = new Dictionary<string, object>();

            parameters.Add("page", 1);
            parameters.Add("rowsCount", 10);
            parameters.Add("IdPropertyImage", -1);
            parameters.Add("IdProperty", -1);

            var result = (IEnumerable<PropertyImageEntity>)service.Read(parameters);
            Assert.IsInstanceOf<IEnumerable<PropertyImageEntity>>(result);
            Assert.IsNotNull(result);

        }


        [Test]
        public void Read_Quantity()
        {

            Dictionary<string, object> parameters = new Dictionary<string, object>();

            parameters.Add("page", 1);
            parameters.Add("rowsCount", 10);
            parameters.Add("IdPropertyImage", -1);
            parameters.Add("IdProperty", -1);

            var result = (IEnumerable<PropertyImageEntity>)service.Read(parameters);

            Assert.IsNotNull(result);
            Assert.IsInstanceOf<IEnumerable<PropertyImageEntity>>(result);
            Assert.Greater(result.Count(), 0);
        }


        [Test]
        public void Create_OK()
        {

            int id = DateTime.Now.Millisecond;
            service.Delete(id);

            dto.IdPropertyImage = id;
            dto.IdProperty = 35;
            dto.File = "data:image/jpeg;base64,";
            dto.Enabled = "true";

            service.Create(dto);

            Dictionary<string, object> parameters = new Dictionary<string, object>();

            parameters.Add("page", 1);
            parameters.Add("rowsCount", 10);
            parameters.Add("IdPropertyImage", id);
            parameters.Add("IdProperty", -1);

            var result = (IEnumerable<PropertyImageEntity>)service.Read(parameters);

            Assert.IsNotNull(result);
            Assert.AreEqual(result.FirstOrDefault().IdPropertyImage, dto.IdPropertyImage);
            Assert.True(result.Any());

        }



        [Test]
        public void Create_Error()
        {

            int id = DateTime.Now.Millisecond;

            dto.IdPropertyImage = id;
            dto.IdProperty = 77777777;
            dto.File = "data:image/jpeg;base64,";
            dto.Enabled = "true";

            Exception exception = null;

            try
            {
                service.Create(dto);
            }
            catch (Exception ex)
            {
                exception = ex;
            }

            Assert.IsNotNull(exception, "Se esperaba una excepción");
            Assert.IsTrue(exception.Message.Contains("Error al ejecutar el comando en SQL"));

        }



        [Test]
        public void Update_OK()
        {

            dto.IdPropertyImage = 2;
            dto.IdProperty = 1;
            dto.File = "data:image/jpeg;base64,";
            dto.Enabled = "false";

            service.Update(dto);

            Dictionary<string, object> parameters = new Dictionary<string, object>();

            parameters.Add("page", 1);
            parameters.Add("rowsCount", 10);
            parameters.Add("IdPropertyImage", dto.IdPropertyImage);
            parameters.Add("IdProperty", -1);

            var result = (IEnumerable<PropertyImageEntity>)service.Read(parameters);

            Assert.IsNotNull(result);
            Assert.AreEqual(result.FirstOrDefault().IdPropertyImage, dto.IdPropertyImage);
            Assert.True(result.Any());

        }


        [Test]
        public void Delete_OK()
        {

            dto.IdPropertyImage = 2;
            dto.IdProperty = 1;
            dto.File = "data:image/jpeg;base64,";
            dto.Enabled = "false";

            service.Delete(dto.IdPropertyImage);

            Dictionary<string, object> parameters = new Dictionary<string, object>();

            parameters.Add("page", 1);
            parameters.Add("rowsCount", 10);
            parameters.Add("IdPropertyImage", dto.IdPropertyImage);
            parameters.Add("IdProperty", -1);

            var result = (IEnumerable<PropertyImageEntity>)service.Read(parameters);

            Assert.IsNotNull(result);
            Assert.AreEqual(result.Count(), 0);

            service.Create(dto);

        }

    }
}
